import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
//import { Add } from 'material-ui-icons'
import { React, useState, Fragment, useEffect } from 'react';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

function Form() {
    const [open, setOpen] = useState(false);
    const [bAmount, setBAmount] = useState(0);
    const [rate, setRate] = useState(0);
    //const [fee, setFee] = useState(0);
    const [expDate, setExprDate] = useState("");
    const [balanceDate, setBalanceDate] = useState("");
    const [dateFirstPay, setDateFirstPay] = useState("");
    //const [unkValue, setUnkVal] = useState("");
    const [nbp, setnbp] = useState([])
    const classes = useStyles();


    const handleClickOpen = () => {
        setOpen(true);
    }

    const handleClose = () => {
        setOpen(false);
    }

    //Material UI Table
    function createData(terminbelop, renter, gebyr, restgjeld, innbetalingsdato) {
        return { terminbelop, renter, gebyr, restgjeld, innbetalingsdato };
    }

    //handle submit of POST request
    function handleSubmit(e) {
        handleClose();
        e.preventDefault();

        const options = {
            method: 'POST',
            url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
            headers: { 'Content-type': 'application/json' },
            data: {
                laanebelop: bAmount,
                nominellRente: rate,
                terminGebyr: 30,
                utlopsDato: expDate,
                saldoDato: balanceDate,
                datoForsteInnbetaling: dateFirstPay,
                ukjentVerdi: "TERMINBELOP"

            }
        }

        //send the post request and log the response data
        axios(options).then((response) => {
            console.log(response.data)
            setnbp(response.data.nedbetalingsplan.innbetalinger);
        }).catch(function (error) {
            console.log(error);
        });
    }


    const rows = nbp.map(plan => createData(plan.innbetaling, plan.renter, plan.gebyr, plan.restgjeld, plan.dato))

    return (
        <Fragment>
            <Button onClick={handleClickOpen}>
                CREATE
             </Button>
            <Dialog open={open} >
                <DialogTitle >Create a new plan</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Please fill out the form below
          </DialogContentText>
                    <TextField
                        label="Lånebeløp"
                        value={bAmount}
                        onChange={e => setBAmount(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Rente"
                        value={rate}
                        onChange={e => setRate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Utløpsdato"
                        value={expDate}
                        onChange={e => setExprDate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="SaldoDato"
                        value={balanceDate}
                        onChange={e => setBalanceDate(e.target.value)}
                    />
                    <br />
                    <TextField
                        label="Dato første innbetaling"
                        value={dateFirstPay}
                        onChange={e => setDateFirstPay(e.target.value)}

                    />
                    <br />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleSubmit} color="primary">
                        Create
          </Button>
                </DialogActions>
            </Dialog>




        </Fragment>
    )
}
export default Form;
